import React from "react";
// STYLES
import "../styles/Photos.scss";
import photo from "../stockPhotos/art14blk_white15.JPG";
// import photo from "../stockPhotos/v1.46.JPG";
const Photos = () => {
  return (
    <div className='P-Component'>
      <div className='P-Page'>
        <h1 className='Page-Title'>Photography</h1>
        <img className='P-Image' src={photo} alt='' />
        <p className='P-Title'>"Small World" </p>
        <p className='P-Title'>Harold Washington Library</p>
        <p className='P-Location'>Chicago, IL </p>
      </div>
    </div>
  );
};
export { Photos };
